    false,nt"url": null,nt"notes": "The primary goal of the annual water plan
    is to set a strategy for the 'most  efficient use of the available water delivered
    to Stillwater WMA. For all  practical purposes. Fallen NWR no longer receives sufficient
    water from the  Carson River to maintain any quality wetlands. With a severe drought
    facing  Western Nevada, the full effects of the final Operating Criteria and  Procedures
    (OCAP) will not be felt. However, a 70% water year is forecast  which corresponds
    to a 25,000 acre/ft delivery to Stillwater WMA. This is the 1988 plan.",nt"owner_org":
